Thought I’d instantly know how to play Mule Train when I put this bulldozer under my bow, but here’s some Poor Boy Headed Home. Got no lyrics for it. Tuned to a d open according to whatever the d string was out the box. Thanks Matt, thanks J. This one for you. Was gonna spruce a fancy dandy thing, but keep sippin this damn fine cup of coffee like I just ate two mushrooms in Mario & can shoot fireballs out my fingers. Keep safe keep sound, catch ya sooner than later 

@muleresonatorguitars 
@prideofgypsies

@dunemovie

ALOHA! IT’S TIME! #DuneMovie coming October 22.
Aloha j

I’ve always wanted to create my own clothing line with @HarleyDavidson, and now that vision has come to life. I’m so stoked to bring you the H-D X Momoa Collection where I’ve infused my Aloha spirit into classic #HarleyDavidson designs that celebrate our love for the open road. Proud to say the entire collection is All-American made. Check out the full limited-edition collection at the link in my bio. Aloha J 

Shot by : @da_bray

 @ontheroam @boazkroon

On The Roam Knuckle Chopper comin at you. If you didn’t get in on the pre-order here is your chance to get one. Designed by @tabernash and my self. Made in the USA by @nashmotorcycleco . Hammer on one end, chopper on the other. Throw it, chop with it, start it on fire. Either way you’ll love it. A little love for the Knucklehead you can hold in your hand.
Aloha J 
